        from_name: name,
        email: email,
        message: weight
            // "Відпрвка: " + point_of_departure +
            // "\nПрибуття: " + destination +
            // "\nВага: " + weight +
            // "\nТелефон: " + phone
    }

    email_js.send("service_fktr0no", "template_q36cnic", {
            from_name: "Maks",
            email: "mysi",
